webpackJsonp([0xfb3f145874fb],{7384:function(e,t){e.exports={data:{post:{html:'<p>Today\'s Economist print-edition article on <a href="http://www.economist.com/World/europe/displayStory.cfm?story_id=4174513" title="German foreign policy | Rebalancing, not realigning | Economist.com">German foreign policy</a> (subscribers only): "What many in Berlin dread most is that Edmund Stoiber, boss of the CDU\'s Bavarian sister party, the Christian Social Union (CSU), insists on being foreign minister. That would give him a top post, but let him stand above the political fray: it is easier to be popular as foreign minister than as, say, finance minister. Yet Mr Stoiber would hate the travelling, says one insider: \'He doesn\'t even like to leave Bavaria.\'"</p>',fields:{title:"He doesn't even like to leave Bavaria",date:"16 Jul 2005",url:"https://papascott.de/2005-07-16-he-doesnt-even-like-to-leave-bavaria/"}}},pathContext:{slug:"/2005-07-16-he-doesnt-even-like-to-leave-bavaria/",prev:{fields:{title:"90% of Everything is Crap",date:"16 Jul 2005",slug:"/2005-07-16-90-of-everything-is-crap/"}},next:{fields:{title:"When In Doubt, Throw It Out",date:"17 Jul 2005",slug:"/2005-07-17-when-in-doubt-throw-it-out/"}}}}}});
